import React, { Component } from 'react';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Post from "./page/Post";
import Write from "./page/Write";
import Detail from "./page/detail";

/** 
 class App extends Component {
  render() {
    return (
      <div className="App">
          <Post></Post>
          <Modal></Modal>
          <h1>App</h1>

      </div>
    );
  }
}
