function App() {
  return(
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Post />} />
        <Route path="/write" element={<Write />} />
        <Route path="/detail" element={<Detail />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
